import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import UserProvider from "../react-context/user-context";



const CustomApp = ({Component, pageProps}) => {
  return (
    <>
      <UserProvider>
        <Component {...pageProps} />
      </UserProvider>
    </>
  )
};


export default CustomApp;
